import React from "react";

class InterestComponent extends React.Component {
  render(): React.ReactNode {
    return (
      <div className="bg-white w-full h-40 mt-2 p-2">
        <div className="flex w-full p-2">
          <h2>관심종목</h2>
        </div>
        <div className="w-full pl-2 pr-2 pb-1 flex gap-1 flex-myFlex border-b-2">
          <span className="text-sm w-1/2">종목명</span>
          <span className="text-sm w-1/3">현재가</span>
          <span className="text-sm">등락률</span>
          <span className="text-sm">거래량</span>
        </div>
        <ul className="ml-2 mr-2 pt-1">
          <li className="flex gap-1">
            <div className="w-1/2 font-bold text-base">신성델타테크</div>
            <div className="w-1/3 font-bold text-base">47,350</div>
            <div className="border rounded-md bg-blue-600 text-white text-xs p-1 font-bold">-3.37%</div>
            <div className="w-1/3 text-right">-1,471,745</div>
          </li>
        </ul>
      </div>
    );
  }
}

export default InterestComponent;
